const FeedbackForm = (props) => {
    const formSettings = props.formSettings
    return (
        <>
            {formSettings.theme === "dark" ? (
                <div className = "w-screen h-screen bg-[#2a2a2a] text-white justify-center items-center flex flex-row">
                    <div className = "bg-red-500 p-8 rounded-lg border border-white border-opacity-10 text-white w-1/4">

                    </div>
                </div>
            ) : (
                <div>Light Theme</div>
            )}
        </>
    );
};

export default FeedbackForm;
